VALUES ('3270190028055', 'Bûche glacée Chocolats noisettes caramélisées', 'Glace au chocolat noir 39,4% : Eau, lait écrémé reconstitué, sucre, graisse végétale de coprah, sirop de glucose-fructose, cacao maigre en poudre, lactose et protéines de lait, chocolat noir 1,1% (sucre, pâte de cacao, beurre de cacao, matière grasse laitière anhydre, émulsifiant : polyricinoléate de polyglycérol), émulsifiants : mono - et diglycérides d\'acides gras et esters lactiques des mono - et diglycérides d\'acides gras, gélifiants : farine de graines de caroube et gomme guar. Glace au chocolat blanc 33,6% : Lait écrémé reconstitué, sucre, chocolat blanc 3,6% (sucre, beurre de cacao, poudre de lait entier, émulsifiant : lécithines de soja, arôme naturel de vanille), graisse végétale de coprah, lait écrémé concentré, sirop de glucose, émulsifiants : esters lactiques des mono - et diglycérides d\'acides gras et mono - et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar - gomme xanthane. Glace au chocolat au lait noisette et morceaux de noisettes caramélisées 25,5% : Eau, lait écrémé reconstitué, sucre, morceaux de noisettes caramélisées 2,1% (noisettes 2%, sucre, sirop de glucose, miel), sirop de glucose-fructose, graisse végétale de coprah, lactose et protéines de lait, cacao en poudre, pâte de noisette 0,4%, chocolat au lait 0,2% (sucre, beurre de cacao, lactosérum en poudre, matière grasse laitière anhydre, pâte de cacao, lait écrémé en poudre, émulsifiants : lécithines de soja et polyricinoléate de polyglycérol), émulsifiants : mono et diglycérides d\'acides gras et esters lactiques des mono - et diglycérides d\'acides gras, gélifiants : farine de graines de caroube et gomme guar. Décors: _Morceaux de noisettes grillées caramélisées_ 1% : Morceaux de noisettes grillées : 0,7%, sucre 0,3%. Plaquette en chocolat blanc 0,5% : Sucre, beurre de cacao, lait entier en poudre, lait écrémé en poudre, matière grasse laitière anhydre, poudre de cacao maigre, émulsifiants : lécithines de soja et polyricinoléate de polyglycérol, arôme naturel de vanille. Les pourcentages sont exprimés sur l\'ensemble du produit. Traces éventuelles de gluten, d\'œufs, d\'arachides, et d\'autres fruits à coque. Visuel non contractuel.', 'https://static.openfoodfacts.org/images/products/327/019/002/8055/front_fr.14.400.jpg', '13', '9.1', '23', '21', '1.7', '3.5', '0.21', '0.0826771653543307', '', '1');

