INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3270190217190', 'Saumon Fumé Cuite Au Feu De Bois Surgelée', 'Pâte : Farine de hlé, eau, huile de tournesol, levure boulangère, sel. Garniture : Purée de tomates, saumon fumé au bois de hêtre 10,7% (saumon, sel), fromage râpé 10,7% (maasdam 10,3%, fécule de pomme de terre), ccè-me liquide 5,9% (crème, épaississant. carraghénanes), olives noires dénoyautées 2,6% (olives, eau, sel, stabilisant : gluconate ferreux), huile de tournesol, sel, sucre, ail, oignon, origan, herbes de Provence, poivre, arômes naturels. Pourcentages exprimés sur la pizza garnie. Malgré tout le soin apporté à la fabrication de ce produit, il peut contenir des morceaux de noyau d\'olive. @ Pizza met gerookte zalm op beukenhout, kaas en room, gebakken op houtvuur - Diepvries. Ingrediënten: Deeg: Tarwebloem, water, zonnebloemolie, bakkersgist, zout. Garnituur: Tomatenpuree, zalm gerookt op beukenhout 10,7 % (zalm, zout), geraspte kaas 10,7% (maasdam 10,3%, aardappelzetmeel), vloeibare room 5,9% (room, verdikkingsmiddel: carrageen), ontpitte zwarte olijven 2,6% (olijven, water, zout, stabilisator: ijzer(ll)gluconaat), zonnebloemolie, zout, suiker, knoflook, ui, oregano, Provençaalse kruiden, peper, natuurlijke aroma\'s. Percentages uitgedrukt op de pizza met garnituur. Ondanks de zorg die besteed werd aan de productie van dit product, kunnen er nog stukjes olijfpit aanwezig zijn. Conservation / Bewaring @', 'https://static.openfoodfacts.org/images/products/327/019/021/7190/front_fr.6.400.jpg', '8.7', '4.1', '29', '4.5', '1.6', '8.3', '1.4', '0.551181102362205', '', '0');

